import React from "react";

function Projects() {
  function projectBox(name, img, link, src) {
    return (
      <div
        style={{ "background-image": "url('https://i.imgur.com/RrhiXAL.png')" }}
        className="projectContainer"
      ></div>
    );
  }
  return (
    <div className="projects">
      <h1>Projects</h1>
      {projectBox(
        "Weather App",
        "url('https://i.imgur.com/RrhiXAL.png')",
        "https://houston-weather.netlify.com/",
        "https://github.com/johnhartmann26/react-weather"
      )}
    </div>
  );
}

export default Projects;
